using System;\nusing System.Runtime.InteropServices;\n\n// Define the COM interface\n[ComVisible(true)]\n[InterfaceType(ComInterfaceType.InterfaceIsIDispatch)]\npublic interface IMyComInterface\n{\n    string GetCachedData();\n}\n\n// Implement the COM interface\n[ComVisible(true)]\n[ClassInterface(ClassInterfaceType.AutoDispatch)]\npublic class MyComServer : IMyComInterface\n{\n    private string _cachedData;\n\n    public string GetCachedData()\n    {\n        // Return the cached data\n        return _cachedData;\n    }\n}\n\nclass Program\n{\n    static void Main(string[] args)\n    {\n        // Register the COM server\n        Regasm.RegisterAssembly(typeof(MyComServer).Assembly, Regasm.RegistrationFlags.None);\n\n        // Start the COM server\n        var comServer = new MyComServer();\n        comServer.Run();\n    }\n}